import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState(0);
  const logs = ()=>{
    setName(name+1);
  }
  return (
      <div className="divbtn" onClick={logs}>{name}</div>
  );
}

export default AddButton;
